  styleUrls: ['./contactcrud.component.scss']
})
export class ContactcrudComponent {
    username: string="";
    email:string="";
    telephone: { mobile: string, home: string } = { mobile: "", home: "" };

    constructor(private http: HttpClient){

    }

    register(){
      let bodyData = {
        "username": this.username,
